entries to show, defaults to 30.\r\n * \r\n * @link https://wpforms.com/developers/how-to-display-form-entries/\r\n *\r\n * Realtime counts could be delayed due to any caching setup on the site\r\n *\r\n * @param array $atts Shortcode attributes.\r\n * \r\n * @return string\r\n */\r\n  \r\nfunction wpf_entries_table( $atts ) {\r\n  \r\n    // Pull ID shortcode attributes.\r\n    $atts = shortcode_atts(\r\n        [\r\n            \'id\'     => \'\',\r\n            \'user\'   => \'\',\r\n            \'fields\' => \'\',\r\n            \'number\' => \'\',\r\n                        \'type\' => \'all\' // all, unread, read, or starred.\r\n        ],\r\n        $atts\r\n    );\r\n  \r\n    // Check for an ID attribute (required) and that WPForms is in fact\r\n    // installed and activated.\r\n    if ( empty( $atts[\'id\'] ) || ! function_exists( \'wpforms\' ) ) {\r\n        return;\r\n    }\r\n  \r\n    // Get the form, from the ID provided in the shortcode.\r\n    $form = wpforms()->form->get( absint( $atts[\'id\'] ) );\r\n  \r\n    // If the form doesn\'t exists, abort.\r\n    if ( empty( $form ) ) {\r\n        return;\r\n    }\r\n  \r\n    // Pull and format the form data out of the form object.\r\n    $form_data = ! empty( $form->post_content ) ? wpforms_decode( $form->post_content ) : \'\';\r\n  \r\n    // Check to see if we are showing all allowed fields, or only specific ones.\r\n    $form_field_ids = isset( $atts[\'fields\'] ) && $atts[\'fields\'] !== \'\' ? explode( \',\', str_replace( \' \', \'\', $atts[\'fields\'] ) ) : [];\r\n  \r\n    // Setup the form fields.\r\n    if ( empty( $form_field_ids ) ) {\r\n        $form_fields = $form_data[\'fields\'];\r\n    } else {\r\n        $form_fields = [];\r\n        foreach ( $form_field_ids as $field_id ) {\r\n            if ( isset( $form_data[\'fields\'][ $field_id ] ) ) {\r\n                $form_fields[ $field_id ] = $form_data[\'fields\'][ $field_id ];\r\n            }\r\n        }\r\n    }\r\n  \r\n    if ( empty( $form_fields ) ) {\r\n        return;\r\n    }\r\n  \r\n    // Here we define what the types of form fields we do NOT want to include,\r\n    // instead they should be ignored entirely.\r\n    $form_fields_disallow = apply_filters( \'wpforms_frontend_entries_table_disallow\', [ \'divider\', \'html\', \'pagebreak\', \'captcha\' ] );\r\n  \r\n    // Loop through all form fields and remove any field types not allowed.\r\n    foreach ( $form_fields as $field_id => $form_field ) {\r\n        if ( in_array( $form_field[\'type\'], $form_fields_disallow, true ) ) {\r\n            unset( $form_fields[ $field_id ] );\r\n        }\r\n    }\r\n  \r\n    $entries_args = [\r\n        \'form_id\' => absint( $atts[\'id\'] ),\r\n    ];\r\n  \r\n    // Narrow entries by user if user_id shortcode attribute was used.\r\n    if ( ! empty( $atts[\'user\'] ) ) {\r\n        if ( $atts[\'user\'] === \'current\' && is_user_logged_in() ) {\r\n            $entries_args[\'user_id\'] = get_current_user_id();\r\n        } else {\r\n            $entries_args[\'user_id\'] = absint( $atts[\'user\'] );\r\n        }\r\n    }\r\n  \r\n    // Number of entries to show. If empty, defaults to 30.\r\n    if ( ! empty( $atts[\'number\'] ) ) {\r\n        $entries_args[\'number\'] = absint( $atts[\'number\'] );\r\n    }\r\n  \r\n// Filter the type of entries all, unread, read, or starred\r\n    if ( $atts[\'type\'] === \'unread\' ) {\r\n        $entries_args[\'viewed\'] = \'0\';\r\n    } elseif( $atts[\'type\'] === \'read\' ) {\r\n        $entries_args[\'viewed\'] = \'1\';\r\n    } elseif ( $atts[\'type\'] === \'starred\' ) {\r\n        $entries_args[\'starred\'] = \'1\';\r\n    }\r\n  \r\n    // Get all entries for the form, according to arguments defined.\r\n    // There are many options available to query entries. To see more, check out\r\n    // the get_entries() function inside class-entry.php (https://a.cl.ly/bLuGnkGx).\r\n    $entries = wpforms()->entry->get_entries( $entries_args );\r\n  \r\n    if ( empty( $entries ) ) {\r\n        return \'<p>No entries found.</p>\';\r\n    }\r\n  \r\n    ob_start();\r\n  \r\n    echo \'<table class=\"wpforms-frontend-entries\">\';\r\n  \r\n        echo \'<thead><tr>\';\r\n  \r\n            // Loop through the form data so we can output form field names in\r\n            // the table header.\r\n            foreach ( $form_fields as $form_field ) {\r\n  \r\n                // Output the form field name/label.\r\n                echo \'<th>\';\r\n                    echo esc_html( sanitize_text_field( $form_field[\'label\'] ) );\r\n                echo \'</th>\';\r\n            }\r\n  \r\n        echo \'</tr></thead>\';\r\n  \r\n        echo \'<tbody>\';\r\n  \r\n            // Now, loop through all the form entries.\r\n            foreach ( $entries as $entry ) {\r\n  \r\n                echo \'<tr>\';\r\n  \r\n                // Entry field values are in JSON, so we need to decode.\r\n                $entry_fields = json_decode( $entry->fields, true );\r\n  \r\n                foreach ( $form_fields as $form_field ) {\r\n  \r\n                    echo \'<td>\';\r\n  \r\n                        foreach ( $entry_fields as $entry_field ) {\r\n                            if ( absint( $entry_field[\'id\'] ) === absint( $form_field[\'id\'] ) ) {\r\n                                echo apply_filters( \'wpforms_html_field_value\', wp_strip_all_tags( $entry_field[\'value\'] ), $entry_field, $form_data, \'entry-frontend-table\' );\r\n                                break;\r\n                            }\r\n                        }\r\n  \r\n                    echo \'</td>\';\r\n                }\r\n  \r\n                echo \'</tr>\';\r\n            }\r\n  \r\n        echo \'</tbody>\';\r\n  \r\n    echo \'</table>\';\r\n  \r\n    $output = ob_get_clean();\r\n  \r\n    return $output;\r\n}\r\nadd_shortcode( \'wpforms_entries_table\', \'wpf_entries_table\' );\";s:10:\"post_title\";s:21:\"WP-View Forms Entries\";s:12:\"post_excerpt\";s:0:\"\";s:11:\"post_status\";s:7:\"publish\";s:14:\"comment_status\";s:6:\"closed\";s:11:\"ping_status\";s:6:\"closed\";s:13:\"post_password\";s:0:\"\";s:9:\"post_name\";s:21:\"wp-view-forms-entries\";s:7:\"to_ping\";s:0:\"\";s:6:\"pinged\";s:0:\"\";s:13:\"post_modified\";s:19:\"2024-10-09 19:55:19\";s:17:\"post_modified_gmt\";s:19:\"2024-10-09 17:55:19\";s:21:\"post_content_filtered\";s:0:\"\";s:11:\"post_parent\";i:0;s:4:\"guid\";s:56:\"http://nation-sound77.local/?post_type=wpcode&#038;p=319\";s:10:\"menu_order\";i:0;s:9:\"post_type\";s:6:\"wpcode\";s:14:\"post_mime_type\";s:0:\"\";s:13:\"comment_count\";s:1:\"0\";s:6:\"filter\";s:3:\"raw\";}s:5:\"title\";N;s:4:\"code\";N;s:9:\"code_type\";N;s:8:\"location\";s:10:\"everywhere\";s:11:\"auto_insert\";N;s:13:\"insert_number\";N;s:6:\"active\";N;s:4:\"tags\";N;s:29:\"\0WPCode_Snippet\0location_term\";O:7:\"WP_Term\":10:{s:7:\"term_id\";i:10;s:4:\"name\";s:10:\"everywhere\";s:4:\"slug\";s:10:\"everywhere\";s:10:\"term_group\";i:0;s:16:\"term_taxonomy_id\";i:10;s:8:\"taxonomy\";s:15:\"wpcode_location\";s:11:\"description\";s:0:\"\";s:6:\"parent\";i:0;s:5:\"count\";i:2;s:6:\"filter\";s:3:\"raw\";}s:30:\"\0WPCode_Snippet\0code_type_term\";N;s:26:\"\0WPCode_Snippet\0tags_terms\";N;s:25:\"\0WPCode_Snippet\0use_rules\";N;s:21:\"\0WPCode_Snippet\0rules\";N;s:24:\"\0WPCode_Snippet\0priority\";N;s:26:\"\0WPCode_Snippet\0library_id\";N;s:24:\"\0WPCode_Snippet\0cloud_id\";N;s:16:\"custom_shortcode\";N;s:31:\"\0WPCode_Snippet\0library_version\";N;s:20:\"\0WPCode_Snippet\0note\";N;s:25:\"\0WPCode_Snippet\0generator\";N;s:30:\"\0WPCode_Snippet\0generator_data\";N;s:11:\"device_type\";N;s:8:\"schedule\";N;s:14:\"location_extra\";N;s:20:\"shortcode_attributes\";N;s:10:\"attributes\";N;s:12:\"load_as_file\";N;s:8:\"modified\";N;}s:10:\"error_line\";i:112;s:3:\"url\";s:79:\"http://nation-sound77.local/wp-json/wp/v2/pages/320?rest_route=/wp/v2/pages/320\";s:4:\"time\";i:1728531990;}');
