none\\u0022,\\u0022containerBorderWidth\\u0022:\\u00221px\\u0022,\\u0022containerBorderColor\\u0022:\\u0022#000000\\u0022,\\u0022containerBorderRadius\\u0022:\\u00223px\\u0022,\\u0022containerShadowSize\\u0022:\\u0022none\\u0022,\\u0022customCss\\u0022:\\u0022\\u0022,\\u0022pageTitle\\u0022:\\u0022Modifier la page « Gestion du festival Nation Sound » ‹ Nation-Sound77 — WordPress\\u0022}\",\"pageTitle\":\"Gestion du festival Nation Sound\"} /-->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>add_action(\'rest_api_init\', function () {\n    register_rest_route(\'wpforms/v1\', \'/entries/(?P&lt;id>\\d+)\', array(\n        \'methods\' => \'GET\',\n        \'callback\' => \'get_wpforms_entries\',\n        \'permission_callback\' => \'__return_true\',\n    ));\n});\n\nfunction get_wpforms_entries($data) {\n    $form_id = $data&#91;\'id\'];\n    $entries = wpforms()->entry->get_entries(array(\'form_id\' => $form_id));\n    return new WP_REST_Response($entries, 200);\n}\n</code></pre>\n<!-- /wp:code -->','Gestion du festival Nation Sound','','inherit','closed','closed','','304-revision-v1','','','2024-10-09 15:34:03','2024-10-09 13:34:03','',304,'http://nation-sound77.local/?p=311',0,'revision','',0);
